import React from 'react'
import { useSelector } from 'react-redux';

const SearchTicket = () => {
    const ticketDetails = useSelector(state => state.busTicket.ticketDetails)
    
    return (
        <div>
            <input type="text" placeholder='Search Your ticket'/>
        </div>
    )
}

export default SearchTicket
